import React from 'react'
import './Popup.css'

function Popup(props) {
	return (props.trigger) ? (
		<div className="popup">
			<div className="popup-inner">
				<button className="close-btn" onClick={() => props.setTrigger(false)}>close1</button>
				<button className="close-btn" onClick={() => props.setTrigger(false)}>close2</button>
				{props.children}
			</div>
		</div>
	) : "";
}

export default Popup
